Drive-In Horrorshow (2009) 


Five tales of terror to quench your thirst for horror

The Pig 

A sorority girl gets her revenge on a fraternity guy after a rufie-filled evening.

The Closet

A little kid, who is a really bad actor, convinces the monster in his closet to kill his family, who are worse actors.

Fall Apart

A doctor with a heart of gold catches a rapidly flesh-eating disease from a homeless patient and rapidly flesh is eaten.

The Watcher

Jen Morasca (of Survivor fame) and her friends are stalked and killed by a weirdo in the woods.

Meat Man

Two young brothers convince themselves that their father is the urban legend killer The Meat Man.

